import React from 'react';

class Header extends React.Component {

    constructor() {
        super();
        this.state = {
            bookstoreName : "REd Books"
        }
    }

    render () {
        return (
        <div className="row header" >
        <h1>{this.state.bookstoreName}</h1>
        </div>
        );
    }

}

export default Header;
